import React, { useState } from 'react';
import { Form, Button, message, Card, Upload } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import type { UploadFile, UploadProps } from 'antd/es/upload/interface';
import axios from 'axios';

const Training: React.FC = () => {
  const [form] = Form.useForm();
  const [loading, setLoading] = useState(false);
  const [trainingResult, setTrainingResult] = useState<any>(null);
  const [fileList, setFileList] = useState<UploadFile[]>([]); // State for uploaded file list

  const onFinish = async () => {
    if (fileList.length === 0) {
      message.error('请先上传训练数据文件。');
      return;
    }

    setLoading(true);

    const file = fileList[0].originFileObj as Blob; // 获取 Blob 对象

    if (!file) {
      message.error('无法获取文件内容。');
      setLoading(false);
      return;
    }

    const reader = new FileReader();

    reader.onload = async (e) => {
      try {
        const content = e.target?.result as string;
        // 解析 JSON 内容
        const values = JSON.parse(content);

        // 直接发送解析后的 JSON 对象
        const response = await axios.post('/api/train', values);

        message.success('训练成功！');
        setTrainingResult(response.data.parameters);
        console.log('训练结果:', response.data);
      } catch (error: any) {
        console.error('训练失败:', error);
        console.log('Backend Error Response:', error.response);
        let errorMessage = '训练失败：';
        if (error.response && error.response.data && typeof error.response.data.detail === 'object') {
          // 检查是否为 Pydantic ValidationError 详细信息
          if (error.response.data.detail.message) {
            errorMessage += error.response.data.detail.message + '\n';
          }
          if (error.response.data.detail.errors && Array.isArray(error.response.data.detail.errors)) {
            error.response.data.detail.errors.forEach((err: any) => {
              errorMessage += `  字段: ${err.loc ? err.loc.join('.') : '未知'}, 错误: ${err.msg}\n`;
            });
          }
        } else if (error.response && error.response.data && error.response.data.detail) {
          errorMessage += error.response.data.detail;
        } else {
          errorMessage += error.message || String(error);
        }
        message.error(errorMessage);
        setTrainingResult(null);
      } finally {
        setLoading(false);
      }
    };

    reader.onerror = (e) => {
      message.error('文件读取失败。');
      setLoading(false);
      console.error('FileReader error:', e);
    };

    reader.readAsText(file); // 将文件内容读取为文本 (JSON)
  };

  const uploadProps: UploadProps = {
    name: 'file',
    accept: '.json',
    maxCount: 1,
    fileList: fileList,
    onRemove: (file) => {
      const newFileList = fileList.filter((item) => item.uid !== file.uid);
      setFileList(newFileList);
      message.info(`已移除文件: ${file.name}`);
      return true;
    },
    beforeUpload: (file) => {
      const isJson = file.type === 'application/json' || file.name.endsWith('.json');
      if (!isJson) {
        message.error('只能上传 JSON 文件!');
        return Upload.LIST_IGNORE; // Prevent upload and show error
      }

      // No FileReader or JSON parsing here, just set the file for onFinish
      setFileList([file]);
      message.success(`${file.name} 文件已选择，点击 &quot;开始训练&quot;。`);
      return false; // Prevent Ant Design Upload from sending the file directly
    },
  };

  return (
    <Card title="参数训练">
      <Form
        form={form}
        layout="vertical"
        onFinish={onFinish}
      >
        <Form.Item
          label="训练数据集 (JSON 文件)"
          rules={[{ required: true, message: '请上传训练数据文件' }]}
        >
          <Upload {...uploadProps}>
            <Button icon={<UploadOutlined />} disabled={fileList.length > 0}>上传训练数据集 (仅限 JSON)</Button>
          </Upload>
        </Form.Item>

        <Form.Item>
          <Button type="primary" htmlType="submit" loading={loading} disabled={fileList.length === 0}>
            开始训练
          </Button>
        </Form.Item>
      </Form>

      {trainingResult && (
        <Card title="训练结果" style={{ marginTop: '20px' }}>
          <p><strong>训练Tag:</strong> {trainingResult.tag || trainingResult.name}</p>
          <p><strong>系数 (w):</strong> {JSON.stringify(trainingResult.w)}</p>
          <p><strong>截距 (b):</strong> {trainingResult.b}</p>
        </Card>
      )}
    </Card>
  );
};

export default Training;
